    font-family: 'Vend Sans';
    font-style: normal;
    font-weight: 400;
    font-display: swap;
    src: url(https://static.pro.cmp.m10s.io/cmp/fonts/VendSans-Regular.woff2) format('woff2');
    unicode-range: U+0000-00FF, U+0131, U+0152-0153, U+02BB-02BC, U+02C6, U+02DA, U+02DC, U+0304, U+0308, U+0329, U+2000-206F, U+20AC, U+2122, U+2191, U+2193, U+2212, U+2215, U+FEFF, U+FFFD;
}

@font-face {
    font-family: 'Vend Sans';
    font-style: normal;
    font-weight: 700;
    font-display: swap;
    src: url(https://static.pro.cmp.m10s.io/cmp/fonts/VendSans-Bold.woff2) format('woff2');
    unicode-range: U+0000-00FF, U+0131, U+0152-0153, U+02BB-02BC, U+02C6, U+02DA, U+02DC, U+0304, U+0308, U+0329, U+2000-206F, U+20AC, U+2122, U+2191, U+2193, U+2212, U+2215, U+FEFF, U+FFFD;
}

* {
    font-family: 'Vend Sans', sans-serif !important;
    box-sizing: border-box !important;
    transition: unset !important;
    line-height: 150% !important;
}

@media (min-width: 600px) {
    .link > a:hover,
    .text-component > a:hover {
        color: #711e17 !important;
        text-decoration: none !important;
    }
    .text:not(h1) {
        font-size: 18px !important;
    }
}

.link > a:focus,
.text-component > a:focus {
    outline: 2px solid #6eaad4 !important;
    border-radius: 8px;
}

.message-button { border-radius: 24px !important; }
.message-button:hover {
    opacity: 1 !important;
}
@media (min-width: 600px) {
    .message-button.primary:hover {
        background: #2b2b30 !important;
    }
    .message-button.secondary:hover {
        background: #eceff2 !important;
    }
}

.message-button.primary:active {
    background: #47474f !important;
}
.message-button.secondary:active {
    background: #e1e7eb !important;
}

.message-button:focus {
    outline: 2px solid #6eaad4 !important;
    outline-offset: 2px;
    box-shadow: none;
}

h1 {
    line-height: 130% !important;
    word-break: break-all;
}

.message {
    box-shadow: 0px 0px 3px 0px rgba(0, 0, 0, 0.25);
}

.btns-container {
    flex-direction: column !important; 
    align-items: stretch !important; 
    box-shadow: 0px 0px 3px 0px rgba(0, 0, 0, 0.25);
}

.navigation-button {
    box-shadow: 0px 2px 4px 0px rgba(113, 117, 134, 0.45) !important;
}

.brand-level-consent:not(.true) {
    display: none;
}

.message-stacks {
    border-radius: 20px 20px 0px 0px;
}

.message-stacks .panel {
    border-bottom: 0;
    padding-left: 56px;
    padding-bottom: 16px;
    padding-right: 16px;
}

.message-stacks .accordion {
    box-shadow: none;
    padding-left: 56px !important;
}

.message-stacks .accordion:focus {
    outline: none;
}
.message-stacks .accordion:focus-visible:before {
    content: '';
    position: absolute;
    top: 0;
    bottom: 0;
    left: 0;
    right: 0;
    border-radius: 16px;
    border: 2px solid #6eaad4;
    pointer-events: none;
}

.chevron {
    width: 24px;
    height: 31px;
    display: flex;
    align-items: center;
    justify-content: center;
    top: 50%;
    transform: translateY(-50%);
    left: 8px;
}

.chevron:before {
    background-image: url('https://static.pro.cmp.m10s.io/cmp/chevron_down_20231017.svg');
    width: 12px !important;
    height: 7px !important;
    border: 0 !important;
    transform: rotate(0deg) !important;
    position: static;
    transition: 0.2s;
}

.chevron.up:before {
    transform: rotate(180deg) !important;
}

.logo-component {
    border-radius: 50% !important;
}

.logo-component[alt="none logo"] {
    display: none;
}

.top-bar {
    flex-direction: column !important;
    gap: 8px;
    align-items: flex-start;
}

.logos-col {
    border-radius: 100px !important;
}

.container::-webkit-scrollbar {
  width: 4px;
}
.container::-webkit-scrollbar-thumb {
  border-radius: 32px;
  background-color: #E4E4E1;
}

@media (max-width: 599px) {
    .message-container {
        height: 100%;
    }
    .container {
        overflow: scroll;
        /*height: calc(100vh - 40px - 25px - 24px - 160px - env(safe-area-inset-bottom) - env(safe-area-inset-top)) !important;*/
        height: calc(100% - 160px) !important;
        padding-right: 16px !important;
        display: block;
    }
    .message {
        display: block;
        margin: 40px 24px 25px;
        height: calc(100% - 40px - 25px) !important;
        overflow: hidden;
    }
    .navigation-button {
        font-size: 12.6px !important;
        padding: 4px 12px !important;
    }
    .text-component {
        margin-bottom: 8px !important;
    }
    .btns-container {
        padding: 24px 16px !important;
        box-shadow: 0px 0px 3px 0px rgba(0, 0, 0, 0.25);
        margin: 0 -16px !important;
    }
    .message-safe-area {
        overflow: hidden;
    }
}


@media (min-width: 600px) {
    .message {
        border-radius: 20px !important;
        padding: 40px 32px 0 32px !important;
        margin: 24px 0;
    }
    .top-bar {
        margin-bottom: 24px !important;
        flex-direction: row-reverse !important;
        align-items: center !important;
    }
    .btns-container { 
        margin-left: -32px !important;
        margin-right: -32px !important;
        padding: 32px 32px 40px !important;
        border-bottom-left-radius: 20px !important;
        border-bottom-right-radius: 20px !important;
    }
    .logo-component {
        width: 40px !important;
        height: 40px !important;
    }
    h1 {
        font-size: 32px !important;
        padding-top: 0 !important;
    }
    .container {
        max-height: calc(100vh - 48px - 40px - 184px);
        overflow: auto;
    }
}

.message-stacks .stack:hover { background: transparent; }
